style.css:
/* Change background color */
body {
    background-color: #f0f0f0;
}

/* Change font style */
h1, h2, h3, h4, h5, h6 {
    font-family: 'Arial', sans-serif;
    color: #333;
}

/* Customize buttons */
button {
    background-color: #007bff;
    color: white;
    border-radius: 5px;
}
